{"operationName":"Massets","variables":{"account":"","hasAccount":false},"query":"query Massets($account: String!, $hasAccount: Boolean!) {
  massets {
    id
    token {
      ...TokenAll
      __typename
    }
    feeRate
    redemptionFeeRate
    invariantStartTime
    invariantStartingCap
    invariantCapFactor
    basket {
      failed
      collateralisationRatio
      undergoingRecol
      bassets: bassets(where: {removed: false}) {
        ...BassetAll
        __typename
      }
      removedBassets: bassets(where: {removed: true}) {
        id
        token {
          ...TokenAll
          __typename
        }
        __typename
      }
      __typename
    }
    currentSavingsContract {
      id
      __typename
    }
    savingsContractsV1: savingsContracts(where: {version: 1}) {
      ...SavingsContractAll
      totalCredits {
        ...MetricFields
        __typename
      }
      creditBalances(where: {account: $account}) @include(if: $hasAccount) {
        amount
        __typename
      }
      __typename
    }
    savingsContractsV2: savingsContracts(where: {version: 2}) {
      ...SavingsContractAll
      token {
        ...TokenAll
        __typename
      }
      __typename
    }
    __typename
  }
}

