{"operationName":"FeederPools","variables":{"account":"","accountId":"","hasAccount":false},"query":"query FeederPools($account: String!, $accountId: ID!, $hasAccount: Boolean!) {
  feederPools {
    id
    swapFeeRate
    redemptionFeeRate
    governanceFeeRate
    dailyAPY
    price
    invariantK
    basket {
      bassets {
        ...BassetAll
        __typename
      }
      undergoingRecol
      failed
      __typename
    }
    token {
      ...TokenAll
      __typename
    }
    fasset {
      ...TokenAll
      __typename
    }
    masset {
      id
      __typename
    }
    vault {
      ...BoostedSavingsVaultAll
      __typename
    }
    accounts(where: {account: $account}) @include(if: $hasAccount) {
      balance
      price
      lastUpdate
      balanceVault
      priceVault
      lastUpdateVault
      cumulativeEarned {
        exact
        decimals
        __typename
      }
      cumulativeEarnedVault {
        exact
        decimals
        __typename
      }
      __typename
    }
    __typename
  }
  saveVaults: boostedSavingsVaults(where: {feederPool: null}) {
    ...BoostedSavingsVaultAll
    __typename
  }
  userVaults: accounts(where: {id: $accountId}) {
    id
    boostDirection {
      directorVaultId
      __typename
    }
    __typename
  }
  boostDirectors {
    id
    __typename
  }
  vaultIds: boostedSavingsVaults {
    directorVaultId
    id
    __typename
  }
}

fragment BassetAll on Basset {
