fragment BoostedSavingsVaultAll on BoostedSavingsVault {
  id
  lastUpdateTime
  lockupDuration
  unlockPercentage
  periodDuration
  periodFinish
  rewardPerTokenStored
  rewardRate
  stakingContract
  stakingToken {
    address
    symbol
    __typename
  }
  totalStakingRewards
  totalRaw
  totalSupply
  priceCoeff
  boostCoeff
  platformRewardPerTokenStored
  platformRewardRate
  platformRewardsToken {
    address
    symbol
    __typename
  }
  rewardsToken {
    address
    symbol
    __typename
  }
  rewardAddedTransactions(orderBy: timestamp, orderDirection: desc, first: 1) {
    id
    block
    timestamp
    amount
    platformAmount
    __typename
  }
  accounts(where: {account: $account}) @include(if: $hasAccount) {
    id
    boostedBalance
    lastAction
    lastClaim
    rawBalance
    rewardCount
    rewardPerTokenPaid
    rewards
    platformRewardPerTokenPaid
    platformRewards
    rewardEntries(orderBy: index, orderDirection: asc) {
      id
      finish
      index
      rate
      start
      __typename
    }
    __typename
  }
  __typename
}
"}

